CREATE TABLE IF NOT EXISTS "staffs_useractionlog" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_type" varchar(20) NOT NULL, "details" text NOT NULL, "timestamp" datetime NOT NULL, "performed_by_id" bigint NULL REFERENCES "staffs_user" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "staffs_user" ("id") DEFERRABLE INITIALLY DEFERRED);
